import React from "react";

import { NavLink } from "react-router-dom";

const Subnav= () =>{
    




    return (
        <>
            <div>
             <NavLink exact activeClassName='active_class' to= '/qualification' >Graduation</NavLink>
        <NavLink exact activeClassName='active_class' to= '/habbits' >Habbits</NavLink>
        <NavLink exact activeClassName='active_class' to= '/personal' >personalinfo</NavLink>
                
            </div>
        </>
    )
}
export default Subnav;
